import React from 'react';
import './App.css';
import Articulo from './componentes/Articulo';

function App() {
  return (
    <div className="App">
      <Articulo titulo="Calendario" resumen="Agosto mes de las artes" idioma="eng"/>
    </div>
  );
}

export default App;
